import React from 'react';
import './App.css';

const Add = props => <h1>{props.a + props.b}</h1>

const Layout = props => (
  <div>
      <header>
      </header>
      <main>
        {props.children}
        <Add a={2} b={3}></Add>
      </main>
      <footer>My Footer</footer>
  </div>
);

function App() {
  return (
    <Layout>
      <p>Page1</p>
    </Layout>

  );
}

export default App;
